import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Request from '../Actions/Request';
import Navbar from './Navbar';


function Home() {
    const [doctors, setDoctors] = useState([]);

    useEffect(() => {
        async function getAllDoctors() {
            const config = {
                headers: {
                    'Content-Type': 'application/json',
                    'Accept': 'application/json'
                }
            };

            const res = await axios.get(Request.doctorInfo, config);
            setDoctors(res.data);
        }

        getAllDoctors();

    }, []);


    return (
        <div>
            <Navbar />
            <div className='container mt-5'>
                <div className='row'>
                    {doctors.map((doctor) => {
                        return (
                            <div className='col-3 mt-3'>
                                <div className='card'>
                                    <img class="card-img-top w-75 h-50" src="https://i.pinimg.com/originals/54/57/40/545740f4960a1f7e4e03a4726ce4440f.jpg" />
                                    <div className='card-body'>
                                        <h5 class="card-title">{doctor.name}</h5>
                                        <p class="card-text">Start Time : {doctor.day_start_time} <br /> End Time : {doctor.day_end_time} <br /> Slot Period : {doctor.appointment_slot_time}</p>
                                    </div>
                                </div>
                            </div>
                        );
                    })}

                </div>
            </div>
        </div>
    )
}

export default Home;
